import React, { Component } from "react";
import {Redirect} from "react-router-dom";
import { connect } from "unistore/react";
import { actions } from "../store";


class Profile extends Component {

    constructor(props) {
        super(props);
        this.state = {

        };
      }

    componentDidMount = () => {
        console.log("is_login", this.props.is_login);
        if(!this.props.is_login){
            return (<Redirect to={{pathname: "/signin"}} />);
        }
    }


    render() {
        return (

            <section className="content container">
                <div className="container-profile">
                    <div className="row">
                    {/* <p>safdosahdosahdiahsdoihsad</p> */}
                        <div className="col-2">
                            <div className="profile-picture">
                                <img id="profpic" src={this.props.avatar}></img>                            
                            </div>
                        </div>
                        <div className="col-10">
                            <div className="user-profile">
                                <h3><label>Name: </label>{this.props.pembeli_username}</h3>
                                <div style={{marginTop:"100px"}}>
                                <p><label>token: </label>{this.props.api_key}</p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
};

export default connect(["is_login", "api_key", "pembeli_username", "avatar"], actions)(Profile);
